import React from 'react'

function Display() {
  return (
    <div className='w-full'>
        <div className='custom-shadow flex justify-between items-center custom-bg p-4 rounded-2xl text-yellow-400'>
          <h1 id="display-content" className='text-2xl font-semibold'>PASSWORD</h1>
          <FontAwesomeIcon icon="fa-light fa-copy" style={{color: "#23b2e1",}} />
        </div>
    </div>
  )
}

export default Display
